window.bookSummaryJSON = "<p>When Peter Pan discovers his forbidden magic, he’s faced with an ultimatum.</p> <p>Stay in London, or escape to a whole new world. A place where a fairy named Tinker Bell is his most loyal companion, pirates rule the seas, mermaids are friends with the fae, and lost boys live out their childish dreams.</p> <p>But leaving London comes with a price.</p> <p>Wendy Moira Angela Darling.</p> <p>When Peter decides to steal Wendy away one night, headed for the second star to the right, Tinker Bell’s jealousy grows. The lost boys turn on him. The mermaids and fae work against him. And an evil, dangerous shadow falls on Neverland.</p> <p>Jas Hook.</p>"; 
